import React from "react";

const sampleData = {
  project: "Gaming Setup",
  budget: 1300,
  categories: [
    {
      name: "Monitors",
      products: [
        { name: "Acer Nitro 24''", price: 199, image: "https://via.placeholder.com/150" },
        { name: "LG UltraGear 27''", price: 279, image: "https://via.placeholder.com/150" },
        { name: "Samsung Odyssey 32''", price: 349, image: "https://via.placeholder.com/150" },
      ],
    },
    {
      name: "Keyboards",
      products: [
        { name: "Logitech G213", price: 69, image: "https://via.placeholder.com/150" },
        { name: "Corsair K55", price: 89, image: "https://via.placeholder.com/150" },
        { name: "Razer Cynosa", price: 99, image: "https://via.placeholder.com/150" },
      ],
    },
    {
      name: "Mice",
      products: [
        { name: "Logitech G502", price: 59, image: "https://via.placeholder.com/150" },
        { name: "Razer Basilisk", price: 79, image: "https://via.placeholder.com/150" },
        { name: "SteelSeries Rival 5", price: 69, image: "https://via.placeholder.com/150" },
      ],
    },
  ],
};

export default function Results() {
  return (
    <div className="min-h-screen bg-white text-black px-6 py-10">
      <h1 className="text-3xl font-bold text-center mb-2">
        {sampleData.project} Recommendations
      </h1>
      <p className="text-center text-gray-600 mb-10">
        Estimated Budget: <strong>€{sampleData.budget}</strong>
      </p>

      <div className="space-y-16">
        {sampleData.categories.map((category) => (
          <div key={category.name}>
            <h2 className="text-2xl font-semibold mb-6 border-b pb-1 border-gray-300">
              {category.name}
            </h2>
            <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 gap-6">
              {category.products.map((product, index) => (
                <div
                  key={index}
                  className="border rounded-xl p-4 flex flex-col items-center shadow-sm hover:shadow-md transition"
                >
                  <img
                    src={product.image}
                    alt={product.name}
                    className="w-32 h-32 object-contain mb-4"
                  />
                  <p className="font-medium text-center">{product.name}</p>
                  <p className="text-gray-700">€{product.price}</p>
                  <button className="mt-3 px-3 py-1 text-sm bg-black text-white hover:bg-red-600 transition">
                    + Add
                  </button>
                </div>
              ))}
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}
